4,2 kg','25,0 cm','38,0 cm','24,9 cm','7,49 EUR','Weinlagerstein für 6 Flaschen','Weinlagerziegel sind rustikale grobkeramische Hohlkörper aus Ton und dienen zur idealen Lagerung guter Weine.\\n\\nFür 6 Flaschen\\nSofort einsetzbar\\nAus Ton',0),(6,'4,20 kg','11,3 cm','17,5 cm','24,0 cm','1,09 EUR','Mauerziegel 3DF 24 x 17,5 x 11,3 cm','Mauerziegel bieten ideale Voraussetzungen für gesundes Wohnen. Der Mauerstein ist ein Produkt aus den natürlichen Rohstoffen Lehm, Ton und Wasser.\\n\\nHohe Schall- und Wärmedämmung\\nGelochter Stein\\nFür tragendes und nichttragendes geschütztes Mauerwerk',0),(7,'4,50 kg','24,0 cm','11,5 cm','7,1 cm','1,19 EUR','Mauerziegel / Kanalklinker NF 24 cm x 11,5 cm x 7,1 cm','Der Mauerziegel / Kanalklinker ist ein klassischer Mauerziegel aus den natürlichen Rohstoffen Lehm, Ton und Wasser. Er ist vielseitig einsetzbar und kann  vor allem im Außenbereich verwendet werden.\\nLieferbedingungen:\\n1. Die Anlieferung erfolgt i. d. R. durch einen LKW mit Mitnahmestapler oder Ladebordwand, d. h. vor Ort muss die Zufahrtsmöglichkeit mit Sattelzügen (zulässiges Gesamtgewicht 40 t, Länge bis zu 20 m, Mindesthöhe 4 m) gewährleistet werden. Im Zweifelsfall obliegt es dem Fahrzeugführer, ob die Anlieferung aus Gründen der Sicherheit und der Risikovermeidung erfolgen kann oder nicht.\\n2. Der Empfänger oder eine beauftragte Person ist bei der Anlieferung anwesend und ermöglicht eine zügige Entladung.\\n3. Die Entladung erfolgt frei Bordsteinkante und ebenerdig auf festem Untergrund. Keine Entladung auf Flachdächern, in Garagen oder über Gegenständen.  Keine Entladung unterhalb von Leitungen oder sonstigen Hindernissen innerhalb des Wirkungskreises des Kranes/ des Staplers.  Für die Zulässigkeit und Sicherung des Standortes insbesondere auf öffentlichen Wegen ist der Endkunde verantwortlich. Hierfür erforderliche Genehmigungen müssen vorliegen.  Für die Beschaffung der Zufahrstraßen und Entladestraße darf es keine Beschränkungen für LKW Gewichtsbeschränkungen oder generelles LKW-Verbot) geben. Die Zuwegung muss ausreichend befestigt und möglich sein. Wendemöglichkeit bzw. Durchfahrtsmöglichkeiten beachten. Durchfahrtsmöglichkeit anderer Verkehrsteilnehmer muss bei Entladung gewährleistet sein. Besteht Gefahr für die Gesundheit des Fahrzeugführers oder anderer Verkehrsteilnehmer bzw. Gefahr der Beschädigung von Gegenständen kann der Fahrzeugführer die Anlieferung verweigern.\\n4. Es erfolgt keine Inselbelieferung.\\nLieferterminangaben zum Zeitpunkt der Auftragserfassung definieren nur die voraussichtliche Anlieferung (Fixterminvorgaben sind grundsätzlich nicht möglich). Die Anlieferung wird durch den Spediteur wenige Tage zuvor telefonisch bei Ihnen avisiert.\\nMit der Onlinebestellung des Produkts ist der Endkunde mit den oben genannten Lieferbedingungen einverstanden. Bei der Nichterfüllung können Kosten entstehen, die der Empfänger zu tragen hat.\\n\\nLeicht zu verarbeiten\\nVielseitig einsetzbar',0),(8,'12,8 kg','30,7 cm','24,0 cm','24,9 cm','3,29 EUR','Unipor Mauerziegel 10 DF 30,7 cm x 24 cm x 23,8 cm','Mauerziegel bieten ideale Voraussetzungen für gesundes Wohnen. Der Mauerstein ist ein Produkt aus den natürlichen Rohstoffen Lehm, Ton und Wasser.\\n\\nHohe Schall und Wärmedämmung\\nGelochter Stein',0),(9,'14,5 kg','11,5 cm','7,1 cm','100,0 cm','7,99 EUR','Mauersturz 11,5 cm x 7,1 cm x 100 cm','Der Ziegelsturz bietet ideale Voraussetzungen für gesundes Wohnen. Der Ziegelsturz ist ein Produkt aus den natürlichen Rohstoffen Lehm, Ton und Wasser.\\n\\nNichttragende Stürze für die Verwendung von Mauern, Wänden und Trennwänden',0),(10,'13,0 kg','25,0 cm','19,0 cm','19,0 cm','5,99 EUR','Christoph Zaun-Fundament 19 cm x 19 cm x 25 cm','Der Christoph Zaun-Fundament-Stein hat die Maße 19 cm x 19 cm x 25 cm (B x T x H) erleichtert Ihnen den Aufbau von Zäunen sowie Sichtschutzelementen, indem er für eine vereinfachte Ausrichtung der Zaunpfosten sorgt. Er bietet vielseitige Einsatzmöglichkeiten und zeichnet sich durch höchste Stabilität aus.\\nDer Zaun-Fundament-Stein besteht aus robustem und widerstandsfähigem Vollbeton. Er bietet höchste Stabilität bei einer feinen Betonstruktur die mit Fase versehen ist. \\nDas Fundament ist mit vier unterschiedlichen Aussparungen für verschiedene Profilgrößen der Pfosten ausgestattet, welche die Verwendung von den meisten gängigen Zaunpfosten, rund oder eckig, ermöglicht. Sobald der Pfosten eingesetzt ist, kann dieser im Anschluss problemlos flucht- und höhengerecht ausgerichtet werden. Hierbei sind auch die in die Oberfläche eingearbeiteten Mittenkreuze aüßerst hilfreich. Darüber hinaus eignet sich das Zaun-Fundament ebenfalls für die Verwendung von Pfostenträger in U-Form und H-Anker (je nach Abmessung). Des Weiteren können Sie Wäschespinnen (Ø 6 cm), Fahnenmaste (Ø 6 cm) oder Sitzgruppen aus Stahl (Rechteckrohre 6 cm x 4 cm als Halterung) mit dem Stein verbinden und einsetzen.\\n6,2 cm x 4,2 cm (für Profilgröße 6 cm x 4 cm)\\n6,2 cm x 6,2 cm (für Profilgröße 6 cm x 6 cm oder Ø 6 cm)\\nØ 4,2 cm (für Profilgröße Ø 4 cm)\\nØ 3,6 cm (für Profilgröße Ø 3,4 cm)\\n\\nVereinfachte Ausrichtung der Zaunpfosten\\nMit vier Aussparungen für verschiedene Profilgrößen\\nVielseitige Einsatzmöglichkeiten',0),(11,'15,1 kg','24,8 cm','17,5 cm','24,8 cm','1,69 EUR','Silka Kalksandstein 6 DF 248 mm x 175 mm x 248 mm','Der Silka Kalksandstein 6 DF bietet mit seiner hohen Qualität besondere Tragfähigkeit sowie Schallschutz. Das Silka Bausystem ist in unterschiedlichen Ausführungen erhältlich und ideal geeignet für rationelle Anwendungslösungen im Wohnungs- und Wirtschaftsbau. Kalksandsteine gehören zu den traditionellsten Baustoffen und zeichnen sich durch ihren umfassenden Schutz und ihre Sicherheit aus.\\nDank seiner hohen Rohdichte ist Kalksandstein besonders schalldämmend. Außerdem schafft er ein gutes Raumklima, denn z. B. bei starker Hitze speichert er in Innenwänden die Kühle der Nacht und gibt sie tagsüber wieder an die Raumluft ab.\\nZusätzlich zeichnet er sich durch seine Stabilität und Langlebigkeit aus, denn auch bei geringen Wanddicken sind sie hoch belastbar.\\nDauerhaft witterungsbeständige Fassaden, die lange schön und intakt bleiben sind dank der Frostbeständigkeit des Silka Kalksandsteins gewährleistet. \\nEin weiterer Pluspunkt für Silka Kalksandstein ist die schnelle und sichere Verarbeitung. Mit kaum einem anderen Baustoff können so wirtschaftlich schlanke und gleichzeitig massive Wände gebaut werden.\\nDer Silka Kalksandstein eignet sich besonders für die Errichtung von Innenwänden sowie Haus- und Wohnungstrennwänden. In Kombination mit den passenden Dämmstoffen / -Verbundsystemen können zweischalige Außenwände und Funktionswände gebaut werden. Aber auch als Design- und Sichtmauerwerk findet dieser Stein Verwendung.\\n\\nTragfähig und frostbeständig\\nSchall- und Brandschutz',0),(12,'20,5 kg','49,7 cm','17,5 cm','23,8 cm','3,29 EUR','Bims Hohlblock HBL 12 DF 49,7 cm x 17,5 cm x 23,8 cm','Der Bims Hohlblock zeichnet sich durch seine hohe Wärmedämmung und leichte Verarbeitung aus. Zudem ist der Bims als Baustoff baubiologisch unbedenklich.\\nLieferbedingungen:\\n1. Die Anlieferung erfolgt i. d. R. durch einen LKW mit Mitnahmestapler oder Ladebordwand, d. h. vor Ort muss die Zufahrtsmöglichkeit mit Sattelzügen (zulässiges Gesamtgewicht 40 t, Länge bis zu 20 m, Mindesthöhe 4 m) gewährleistet werden. Im Zweifelsfall obliegt es dem Fahrzeugführer, ob die Anlieferung aus Gründen der Sicherheit und der Risikovermeidung erfolgen kann oder nicht.\\n2. Der Empfänger oder eine beauftragte Person ist bei der Anlieferung anwesend und ermöglicht eine zügige Entladung.\\n3. Die Entladung erfolgt frei Bordsteinkante und ebenerdig auf festem Untergrund. Keine Entladung auf Flachdächern, in Garagen oder über Gegenständen.  Keine Entladung unterhalb von Leitungen oder sonstigen Hindernissen innerhalb des Wirkungskreises des Kranes/ des Staplers.  Für die Zulässigkeit und Sicherung des Standortes insbesondere auf öffentlichen Wegen ist der Endkunde verantwortlich. Hierfür erforderliche Genehmigungen müssen vorliegen.  Für die Beschaffung der Zufahrstraßen und Entladestraße darf es keine Beschränkungen für LKW Gewichtsbeschränkungen oder generelles LKW-Verbot) geben. Die Zuwegung muss ausreichend befestigt und möglich sein. Wendemöglichkeit bzw. Durchfahrtsmöglichkeiten beachten. Durchfahrtsmöglichkeit anderer Verkehrsteilnehmer muss bei Entladung gewährleistet sein. Besteht Gefahr für die Gesundheit des Fahrzeugführers oder anderer Verkehrsteilnehmer bzw. Gefahr der Beschädigung von Gegenständen kann der Fahrzeugführer die Anlieferung verweigern.\\n4. Es erfolgt keine Inselbelieferung.\\nLieferterminangaben zum Zeitpunkt der Auftragserfassung definieren nur die voraussichtliche Anlieferung (Fixterminvorgaben sind grundsätzlich nicht möglich). Die Anlieferung wird durch den Spediteur wenige Tage zuvor telefonisch bei Ihnen avisiert.\\nMit der Onlinebestellung des Produkts ist der Endkunde mit den oben genannten Lieferbedingungen einverstanden. Bei der Nichterfüllung können Kosten entstehen, die der Empfänger zu tragen hat.\\n\\nLeicht zu verarbeiten\\nGute Wärmespeichereigenschaften',0),(13,'17,0 kg','49,3 cm','24,0 cm','11,5 cm','2,19 EUR','Bims Bauplatte V2 8 DF 49,3 cm x 24 cm x 11,5 cm','Die Bimsbauplatte ist ein hochwärmedämmendes Mauerbauwerkstoff. Sie zeichnet sich durch ihre gute Wärmeleitfähigkeit und leichte Verarbeitung aus. Zudem ist der Bims als Baustoff baubiologisch unbedenklich.\\nLieferbedingungen:\\n1. Die Anlieferung erfolgt i. d. R. durch einen LKW mit Mitnahmestapler oder Ladebordwand, d. h. vor Ort muss die Zufahrtsmöglichkeit mit Sattelzügen (zulässiges Gesamtgewicht 40 t, Länge bis zu 20 m, Mindesthöhe 4 m) gewährleistet werden. Im Zweifelsfall obliegt es dem Fahrzeugführer, ob die Anlieferung aus Gründen der Sicherheit und der Risikovermeidung erfolgen kann oder nicht.\\n2. Der Empfänger oder eine beauftragte Person ist bei der Anlieferung anwesend und ermöglich